def par_diff(dic, diff):
    """
    Donne les stratgies qui ont donn une diffrence de diff
    OUTPUT = [((carre,move,nb), dicassoci)]
    """
    result=[]
    for c in dic:
        for m in dic[c]:
            for n in dic[c][m]:
                dicasso=dic[c][m][n]
                if dicasso['totaldiff']==diff and dicasso["totalwin"]==2:
                    result.append(((c,m,n), dicasso))
    return result

